ERROR - 2024-03-06 10:16:01 --> Query error: Incorrect string value: '\xD0\x9E \xD0\xBF\xD0...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (9139, 'Robertvof', 'danilovamarkella19953880@mail.ru', '1970-01-01', 'San Miguel de Tucuman', 'Argentina', 'Argentina', '153131', '', '', 'Robertvof', '', 'О подоплеке уголовного дела ПК Бествей', 'О подоплеке уголовного дела ПК Бествей', 'Дело \\\"Бест Вей\\\": кто стоит за попыткой уничтожения кооператива \r\n<a href=https://www.nationaljournal.ru/articles/2023-05-11/kooperativ/5787/>О подоплеке уголовного дела ПК Бествей </a> \r\nКрупнейший в России кооператив \\\"Бест Вей\\\", у которого более 20 тысяч пайщиков, находится под угрозой уничтожения — и всё из-за уголовного дела, за которым стоят заинтересованные лица. \r\n \r\nПовод для заведения дела был более чем убедительный — по мнению силовиков, участники кооператива похищали деньги у граждан под предлогом инвестирования. Но так ли это на самом деле? \r\n \r\nНачнём с того, что дело было заведено на основании заявлений граждан, которые давно не являются пайщиками кооператива. При этом многие из потерпевших имеют отношение к деятельности зарегистрированного в Ухте ЖК \\\"Вера\\\". \r\nНе последнюю роль в заведении уголовного дела сыграл и Центробанк в Питере, который призывал разобраться с кооперативом. Специалисты ЦБ были крайне недовольны работой кооператива, в частности, были претензии к статусу организации. Юристы кооператива, несмотря на отсутствие оснований, прислушались к рекомендациям ЦБ, в устав даже были внесены изменения, в 2021 году кооператив превратился из жилищного в потребительский. Но Центробанк всё равно не захотел продолжать диалог, и в ноябре 2021 года \\\"Бест Вей\\\" попал в чёрный список как организацию с признаками финансовой пирамиды, спустя месяц после возбуждения уголовного дела. \r\nИнтересно, что к жилищному кооперативу \\\"Вера\\\", устав которого был полностью скопирован у \\\"Бест Вэя\\\", у ЦБ претензий нет. \r\n \r\nЗавесу тайны приоткрыл выступивший в эфире Первого кооперативного радио секретарь Общественного движения кооператоров (ОДК) Иван Коршунов. Отвечая на вопросы слушателей, среди которых оказалась пайщица кооператива \\\"Бест Вей\\\", Коршунов признался, что борется с кооперативами-мошенниками и имеет все на это полномочия как председатель правления организации \\\"Федеральная контрольная палата по надзору за соблюдением законности и правопорядка\\\". Важное дополнение, что Коршунов — ещё и ревизор ЖК \\\"Вера\\\". \r\n \r\nЧто касается дела \\\"Бест Вея\\\", то, со слов Коршунова, возбуждено оно было с подачи контрольной палаты после того, как к ним обратились граждане, пострадавшие от инвестиционной компании \\\"Гермес\\\" и компании \\\"Лайф-из-Гуд\\\", аффилированных с \\\"Бест Вей\\\". Но именно силовики за компанию приписали к делу кооператив \\\"Бест Вей\\\", который просто попал случайно под раздачу. \r\nВсё не так просто и с потерпевшими, многие из которых имеют очевидное отношение к кооперативу \\\"Вера\\\". Так, некая Н. В. Школьник, одна из подавших заявление, возглавляла отделение \\\"Федеральной контрольной палаты\\\" в Республике Коми, при этом на сайте кооператива \\\"Вера\\\" размещён её хвалебный отзыв о работе организации. Ещё одна якобы потерпевшая — Л. А. Елфимова — возглавляет кооператив \\\"Вера\\\". \r\n \r\nОтдельно стоит упомянуть и то, как \\\"грязно\\\" работают следователи, стремясь увеличить количество потерпевших, они почти на год заблокировали счета кооператива, провели обыски у рядовых пайщиков. Цель их очевидна — заставить людей перейти на сторону следствия. \r\n \r\nПопытка уничтожения кооператива — явно результат усилий ряда заинтересованных лиц. \r\n \r\nЦБ заинтересован в том, чтобы контролировать потребительские кооперативы и держать их подальше от коммерческих банков. \r\nИван Коршунов и другие лица, ранее причастные к компании \\\"Лайф-из-Гуд\\\", \\\"Гермесу\\\" и кооперативу \\\"Бест Вей\\\", заинтересованы убрать конкурентов. \r\nСиловики всего лишь хотят выслужиться, чтобы получить очередную награду. \r\nНо от подобных разборок страдают обычные люди — пайщики, которые лишены возможности пользоваться своими деньгами. Несёт убытки и государство, которое не получает налоги, остались без работы и сотрудники кооператива. \r\n \r\nПравосудие должно состояться, важно дать кооперативу возможность работать в рамках закона, дабы защитить интересы тысяч пайщиков.', 'Дело \\\"Бест Вей\\\": кто стоит за попыткой уничтожения кооператива \r\n<a href=https://www.nationaljournal.ru/articles/2023-05-11/kooperativ/5787/>О подоплеке уголовного дела ПК Бествей </a> \r\nКрупнейший в России кооператив \\\"Бест Вей\\\", у которого более 20 тысяч пайщиков, находится под угрозой уничтожения — и всё из-за уголовного дела, за которым стоят заинтересованные лица. \r\n \r\nПовод для заведения дела был более чем убедительный — по мнению силовиков, участники кооператива похищали деньги у граждан под предлогом инвестирования. Но так ли это на самом деле? \r\n \r\nНачнём с того, что дело было заведено на основании заявлений граждан, которые давно не являются пайщиками кооператива. При этом многие из потерпевших имеют отношение к деятельности зарегистрированного в Ухте ЖК \\\"Вера\\\". \r\nНе последнюю роль в заведении уголовного дела сыграл и Центробанк в Питере, который призывал разобраться с кооперативом. Специалисты ЦБ были крайне недовольны работой кооператива, в частности, были претензии к статусу организации. Юристы кооператива, несмотря на отсутствие оснований, прислушались к рекомендациям ЦБ, в устав даже были внесены изменения, в 2021 году кооператив превратился из жилищного в потребительский. Но 